import React, { useEffect, useState } from 'react';

function Profile(props) {

    const [user, setUser] = React.useState('');

    useEffect(() => {
        const { handle } = props.match.params
        setUser(handle);
    })

    return (
        <div className="container-fluid">
            <div className="row">
                <div className="col-12">
                    {user}
                </div>
            </div>
        </div>
    );
}

export default Profile;
